    @Test
    @SneakyThrows
    public void test02() {
        String inputFilePath = "src/main/java/base64Test/pdfBase64.txt"; // 
        String outputFilePath = "src/main/java/base64Test/output.sel"; // 

        //  Base64 
        String base64String = new String(Files.readAllBytes(Paths.get(inputFilePath)));
        // base64String = Base64.toBase64String(Hex.decode(base64String));
        System.out.println(base64String);
        //  Base64 
        byte[] decodedBytes = Base64.decode(base64String);
        try (OutputStream stream = new FileOutputStream(outputFilePath)) {
            stream.write(decodedBytes);
        }
        System.out.println("File written successfully.");
    }

